#import "UIColor+NSColor.h"

@implementation UIColor (NSColor)

+ (UIColor *)backGrayColor {
    return UIColorMake(0xEDEDED);
}

+ (UIColor *)lightGrayColor {
    return UIColorMake(0x7F7F7F);
}

+ (UIColor *)lineColor {
    //return UIColorMake(0xDDDDDD);   //1.0
    return UIColorMake(0xEEEEEE);
}

@end
